import HelloWorld from './components/HelloWorld';

import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
  return (
    <Router>
      <ul>
        <li>Venda na Next Level</li>
        <li>Ofertas do Dia</li>
        <li>Celulares</li>
        <li>Tv e Vídeo</li>
        <li>Informática</li>

      </ul>
    </Router>
  );
}

export default App;
